DIGITS = [
    [0,'z',[]],
    [2,'w',[]],
    [4,'u',[]],
    [6,'x',[]],
    [8,'g',[]],
    [5,'f',[4]],
    [7,'s',[6]],
    [3,'h',[8]],
    [9,'i',[6,8,5]],
    [1,'o',[0,2,4]]
]

class Solution:
    def originalDigits(self, S):
        fmap, ans, n = [0] * 26, [0] * 10, len(S)
        print('-', fmap, ans, n)
        for i in range(10):
            print('0:', i)
            dig, char, rems = DIGITS[i]
            print('1:', dig, char, rems)
            count = S.count(char)
            print('2:', count, rems)
            for rem in rems:
                print('3:', rem)
                count -= ans[rem]
            ans[dig] += count
            print(ans)
        print("".join([str(i) * ans[i] for i in range(10)]))


A=Solution()
A.originalDigits("")
